While I use both cosmeceuticals and several oils to aid in healing, toning, and brightening my skin there are also many oils that are POTENT and spark serious skin reactions and chemical burns due to allergies and photo toxicity if we are not careful! So never apply before you have researched, also why I’m here to help👱🏻‍♀️🌱
To avoid any reactions, you should first dilute the essential oil of your choice with a carrier oil like coconut oil, jojoba oil, or olive oil (mine & @tash.woolley fave!) 
Then do a patch test on the inside of your elbow before using a new essential oil, and keep in mind that some are known irritants, especially if you have sensitive skin. And don't worry — diluting your oils won’t make them any less effective. According to Robert Tisserand's, our skin can actually absorb more of the essential oil through the process of dilution.
I normally choose essential oils that are suitable to use on the face, such as lavender, sandalwood, tea tree, frankincense, Geranium, and the ultimate BLUE TANSY 🙏🏼
(holy grail) of essential oil skincare. 
I also LOVE citrus essential oils, like grapefruit, Sweet orange and jasmine🌷Hint: Tea Tree is a true multitasker, it moisturizes as it cleanses!
